import React from "react";
import styled from "styled-components";
import StyledTriangle from "./Triangles";

const Logo = styled.img`
  width: 15%;
  height: 25%;
  background-color: blue;
`;

const UsedTechnologies = styled.div`
height: 25%;
display: flex;
justify-content: space-around;
align-items: center;
font-size: ${props => props.theme.fontSize.medium}vw;
font-weight: bold;
margin: 0 10vw;
`;

const LinksWrapper = styled.div`
height: 25%;
display: flex;
font-size: ${props => props.theme.fontSize.medium}vw;
font-weight: bold;
justify-content: space-around;
align-items: center;
`;

const ProjectWrapper = styled.div`
  width: 75vw;
  height: 65vh;
  background-color: ${props => props.theme.colors.accentBackground};
  z-index: 1;
  display: flex;
`;

const Project = (props) => {
    return (<ProjectWrapper>
            <Logo/>
            <UsedTechnologies>{props.technologies} project</UsedTechnologies>
            <LinksWrapper>
                Check the source!
            </LinksWrapper>
        </ProjectWrapper>
    )
};

export default Project
